import React, { Component } from "react";

export default class Child extends Component {
  testClick = () => {
    console.log("test");
  };
  render() {
    let { pName, pPrice, pCat, pKey } = this.props.product;

    return (
      <>
        <div className="card text-start col-md-3 " key={pKey}>
          <div className="card-body">
            <h2>{pName}</h2>
            <p>{pPrice}</p>
            <p>{pCat}</p>
            <button
              onClick={this.testClick}
              className="btn btn-danger w-100 my-3"
            >
              Delete
            </button>
          </div>
        </div>
      </>
    );
  }
}
